INSERT INTO `movies` VALUES (1,NULL,'2023-05-05 10:26:32','Avatar',7.9,3,'2009-12-17 00:00:00',120,'https://res.cloudinary.com/ericm76/image/upload/v1683282389/movies/u7fahp0nyt7tyvof5i7n.jpg','Un marine parapljico es enviado a la luna Pandora en una misin nica que se convierte en un debate entre seguir rdenes y proteger el mundo donde se siente como en casa. ',5,'https://res.cloudinary.com/ericm76/image/upload/v1683282390/movies/b6hct5nrca0s7z1lacuk.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683282392/movies/wmqz2hhtu5vzsgqubgip.jpg',1,0,1,'movies/u7fahp0nyt7tyvof5i7n','movies/b6hct5nrca0s7z1lacuk','movies/wmqz2hhtu5vzsgqubgip'),(2,NULL,'2023-05-05 10:46:16','Titanic',7.7,11,'1997-01-19 00:00:00',320,'https://res.cloudinary.com/ericm76/image/upload/v1683283574/movies/ubrginoa62jrfjerrilu.jpg','El buscador de tesoros Brock Lovett se encuentra en los restos del Titanic una pintura de una mujer casi desnuda que porta un collar. Rose, una anciana de 102 aos, revela que ella es quien aparece en el retrato, por lo que es invitada a conocer a un grupo de personas y hablar sobre su experiencia. Fue en 1912 cuando ella fue una de los pasajeros del Titanic junto Jack Dawson (Leonardo DiCaprio), un hombre sin dinero. Rose (Kate Winslet interpretando a la versin joven) regresaba a Philadelphia junto a su familia y su adinerado prometido Cal Hockley (Bill Zane). Despus de conocer al joven Jack, Rose empieza a interesarse en l, creando una reaccin muy negativa en Cal. As comienza una relacin amorosa entre dos jvenes de clases sociales diferentes, que deben de huir del desprecio de Cal y la familia de Jane, quienes desaprueban su comportamiento e intentan alejarlos. ',3,'https://res.cloudinary.com/ericm76/image/upload/v1683283575/movies/ihtvg4xw2alswuugqif9.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683283576/movies/f5ivlttbhm2hstvboba4.jpg',1,0,1,'movies/ubrginoa62jrfjerrilu','movies/ihtvg4xw2alswuugqif9','movies/f5ivlttbhm2hstvboba4'),(3,NULL,'2023-05-05 10:58:15','La Guerra de las galaxias: Episodio VI',9.1,7,'1983-12-16 00:00:00',134,'https://res.cloudinary.com/ericm76/image/upload/v1683284292/movies/yn2hxjttmvb6vvskmzvg.jpg','En la pica conclusin de la saga espacial, el Imperio se prepara para destruir a la Rebelin de una vez por todas, utilizando una nueva y ms poderosa Estrella de la Muerte. Ante esta inminente amenaza, la Tropa rebelde se organiza para llevar a cabo un ataque masivo a la estacin espacial. Mientras ambos bandos calculan sus movimientos, Luke Skywalker (Mark Hamill) y sus fieles aliados emprenden un viaje hacia Tatooine para rescatar al carismtico Han Solo (Harrison Ford) de las garras de Jabba. Tras una visita a su enfermo maestro, Luke confirma no slo la terrible verdad acerca de su ascendencia, sino que su entrenamiento Jedi ha concluido y lo ltimo que queda por hacer es aceptar su destino y confrontar al temible Darth Vader en un emocionante final que determinar el destino de la galaxia. Podr la luz prevalecer y derrotar al lado oscuro de la Fuerza? ',5,'https://res.cloudinary.com/ericm76/image/upload/v1683284294/movies/jth9go6d11iv7euolkry.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683284295/movies/kw5jdxqonbktkk5hxxkr.jpg',1,0,1,'movies/yn2hxjttmvb6vvskmzvg','movies/jth9go6d11iv7euolkry','movies/kw5jdxqonbktkk5hxxkr'),(4,NULL,'2023-05-05 10:55:18','La Guerra de las galaxias: Episodio VII',9.0,6,'2015-12-17 00:00:00',135,'https://res.cloudinary.com/ericm76/image/upload/v1683284114/movies/mb0yddrjrpxw14dmd7qs.jpg','Esta nueva entrega de la Guerra de las Galaxias se establecer 30 aos despus de \'El retorno del Jedi\', contando con una nueva generacin tanto de hroes como de oscuros villanos y, por supuesto, el regreso de algunos de los personajes favoritos de los fans',5,'https://res.cloudinary.com/ericm76/image/upload/v1683284116/movies/xbn8zmenkrqzeuu17mfh.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683284118/movies/jy56qa7zr2pzg1lx30fy.jpg',0,1,1,'movies/mb0yddrjrpxw14dmd7qs','movies/xbn8zmenkrqzeuu17mfh','movies/jy56qa7zr2pzg1lx30fy'),(5,NULL,'2023-05-05 11:00:04','Parque Jurasico',8.3,5,'1993-01-04 00:00:00',127,'https://res.cloudinary.com/ericm76/image/upload/v1683284400/movies/b1eznxefrn1ghglj1485.jpg','Durante una excursin, un parque sufre un problema con su fuente de poder elctrico, por lo que pierden el control de los dinosaurios clonados',5,'https://res.cloudinary.com/ericm76/image/upload/v1683284402/movies/sxdr7tpbvv3l7u5hbkb4.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683284404/movies/bnickkmih7pxlwch8mkj.jpg',0,0,1,'movies/b1eznxefrn1ghglj1485','movies/sxdr7tpbvv3l7u5hbkb4','movies/bnickkmih7pxlwch8mkj'),(6,NULL,'2023-05-05 11:01:17','Harry Potter y las Reliquias de la Muerte - Parte 2',9.0,2,'2011-07-04 00:00:00',130,'https://res.cloudinary.com/ericm76/image/upload/v1683284474/movies/ctgwvhc1acpokovrpmnj.jpg','El final ha llegado. Harry, Hermione y Ron tendrn que recuperar la espada de Gryffindor para encontrar y destruir los ltimos horrocruxes. Mientras tanto, Lord Voldemort est a punto de apoderarse por completo de Hogwarts y de conseguir su objetivo: matar a Harry Potter. La nica esperanza de Harry es encontrar los horrocruxes antes de que Voldemort lo encuentre a l. Buscando pistas, descubre una antigua y olvidada historia: la leyenda de las reliquias de la muerte, que podra dar al malvado Lord el poder definitivo. Pero el futuro de Harry est escrito desde que naci e incluye una misin para la que se ha estado preparando desde que lleg a Hogwarts: la batalla final contra Voldemort.',6,'https://res.cloudinary.com/ericm76/image/upload/v1683284475/movies/peqt30uesatmy6kwltfe.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683284477/movies/dd2qwwi2sxzsgkr0scee.jpg',1,1,1,'movies/ctgwvhc1acpokovrpmnj','movies/peqt30uesatmy6kwltfe','movies/dd2qwwi2sxzsgkr0scee'),(7,NULL,'2023-05-05 11:02:33','Transformers: el lado oscuro de la luna',0.9,1,'2011-06-29 00:00:00',154,'https://res.cloudinary.com/ericm76/image/upload/v1683284549/movies/unogg51hiahzklfolpn4.jpg','El descubrimiento de una nave Cybertroniana oculta en la luna pone a los Autobots y Decepticons en una carrera para llegar a ella y utilizar sus secretos.',5,'https://res.cloudinary.com/ericm76/image/upload/v1683284551/movies/w4yl3gqzkkdirkmr1gyt.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683284553/movies/ikjdpdqlfijm6jqlgtdj.jpg',0,1,1,'movies/unogg51hiahzklfolpn4','movies/w4yl3gqzkkdirkmr1gyt','movies/ikjdpdqlfijm6jqlgtdj'),(8,NULL,'2023-05-05 11:04:08','Harry Potter y la piedra filosofal',10.0,1,'2001-04-04 00:00:00',152,'https://res.cloudinary.com/ericm76/image/upload/v1683284644/movies/fxo1a4fmjvydypiegksz.jpg','El da en que cumple once aos, Harry Potter se entera de que es hijo de dos destacados hechiceros, de los que ha heredado poderes mgicos. En la escuela Hogwarts de Magia y Hechicera, donde se educa con otros nios que tambin tienen poderes especiales, aprender todo lo necesario para ser mago.',8,'https://res.cloudinary.com/ericm76/image/upload/v1683284646/movies/gsv7ojeto1ukn7adxfux.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683284648/movies/wkjjy8pmvxnyiv1lqbjd.jpg',0,0,1,'movies/fxo1a4fmjvydypiegksz','movies/gsv7ojeto1ukn7adxfux','movies/wkjjy8pmvxnyiv1lqbjd'),(9,NULL,'2023-05-05 11:05:28','Harry Potter y la cmara de los secretos',3.5,2,'2002-08-04 00:00:00',200,'https://res.cloudinary.com/ericm76/image/upload/v1683284724/movies/fhs8mb8sus87gk9xuwwj.webp','Terminado el verano, Harry (Radcliffe) no ve la hora de abandonar la casa de sus odiosos tos, pero, inesperadamente se presenta en su dormitorio Dobby, un elfo domstico, que le anuncia que correr un gran peligro si vuelve a Hogwarts. A pesar de los esfuerzos del elfo por retenerlo, Harry es rescatado por Ron y sus hermanos, con la ayuda de un coche volador, y recibido con los brazos abiertos en el clido hogar de los Weasley. A pesar de que a Harry y a Ron les impiden entrar en el andn 9  y subir al Expreso de Hogwarts, ellos se las arreglan para llegar a tiempo de empezar el nuevo curso. Las hazaas de nuestro hroe ya se han extendido por todo el colegio, convirtindolo en el centro de una atencin no deseada. ',8,'https://res.cloudinary.com/ericm76/image/upload/v1683284726/movies/yjlpjwndqelxcb2epdxb.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683284728/movies/ay7y2nrps6moldvs4n7k.jpg',0,1,1,'movies/fhs8mb8sus87gk9xuwwj','movies/yjlpjwndqelxcb2epdxb','movies/ay7y2nrps6moldvs4n7k'),(10,NULL,'2023-05-05 11:06:29','El rey len',9.1,3,'1994-02-04 00:00:00',89,'https://res.cloudinary.com/ericm76/image/upload/v1683284786/movies/eaephomo7lciypmy13za.webp','Una de las animaciones musicales ms populares de Disney, \'\'El Rey Len\'\' presenta la historia del viaje de un len llamado Simba quien algn da segn su destino, se convertir en rey. Durante el recorrido, Simba se va encontrando con diferentes situaciones y compaeros de viaje que le ayudarn a afrontar su destino.',10,'https://res.cloudinary.com/ericm76/image/upload/v1683284787/movies/gph2nrx6aboinukd4s8r.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683284789/movies/hjcugukmqsusew9yp4ch.jpg',1,0,1,'movies/eaephomo7lciypmy13za','movies/gph2nrx6aboinukd4s8r','movies/hjcugukmqsusew9yp4ch'),(11,NULL,'2023-05-05 11:07:26','Alicia en el pas de las maravillas',5.7,2,'2010-07-04 00:00:00',108,'https://res.cloudinary.com/ericm76/image/upload/v1683284842/movies/wdaobnwk40ioebk9onxt.jpg','Alicia, una joven de 19 aos, regresa al mundo mgico donde tuvo una aventura en su niez, reunindose con sus viejos amigos y descubriendo su verdadero destino: acabar con el terrorfico reinado de la Reina Roja. ',NULL,'https://res.cloudinary.com/ericm76/image/upload/v1683284843/movies/amtsvbohb3y9qin5xlcr.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683284846/movies/ovtpeli6r4ab6bdmqw7s.webp',1,0,1,'movies/wdaobnwk40ioebk9onxt','movies/amtsvbohb3y9qin5xlcr','movies/ovtpeli6r4ab6bdmqw7s'),(12,NULL,'2023-05-05 11:08:23','Buscando a Nemo',8.3,2,'2003-07-04 00:00:00',110,'https://res.cloudinary.com/ericm76/image/upload/v1683284900/movies/gypfarydombhfgbbkwfk.webp','En esta gran aventura bajo el agua, con personajes memorables, humor y emocin. Buscando a Nemo sigue el cmico y trascendental viaje de un pez payaso sobre protector, llamado Marlin, y su hijo Nemo, quien es separado de la Gran Barrera del Arrecife , cuando Nemo es llevado de manera inesperada, lejos de su hogar en el ocano y arrojado en un tanque de peces en la oficina de un dentista. Impulsado por la compaa de Dory, una pez amistosa pero olvidadiza, Marlin comienza un peligroso recorrido y se encuentra como el hroe de un intento pico para rescatar a su hijo.',8,'https://res.cloudinary.com/ericm76/image/upload/v1683284902/movies/qzanvedif6pezcurjhwk.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683284903/movies/wd1wwbvmfggnxcm7wjb8.webp',1,0,1,'movies/gypfarydombhfgbbkwfk','movies/qzanvedif6pezcurjhwk','movies/wd1wwbvmfggnxcm7wjb8'),(13,NULL,'2023-05-05 11:09:34','Toy Story',6.1,0,'1995-03-04 00:00:00',81,'https://res.cloudinary.com/ericm76/image/upload/v1683284971/movies/kxtx2ct5ey35damfadbn.jpg','El vaquero Woody es el juguete favorito del pequeo Andy, pero las cosas cambian cuando llega Buzz Lightyear, el hroe espacial de moda. Woody intenta deshacerse de l, pero las cosas no salen como las plane y termina perdindose en la ciudad con Buzz como su nica compaa. Uniendo sus fuerzas para regresar a casa, los dos rivales empiezan una aventura que los lleva a las manos de Sid, un chico del vecindario que destruye juguetes para crear versiones mutantes. Mientras permanecen atrapados en casa de Sid, los dos juguetes crean una amistad genuina y aprenden que a travs del respeto y la confianza es posible escapar del peligro y regresar a casa.',7,'https://res.cloudinary.com/ericm76/image/upload/v1683284972/movies/x4v9e9rbhajfcsmux2or.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683284974/movies/ywj3mye7flslbg0tbck3.jpg',1,0,1,'movies/kxtx2ct5ey35damfadbn','movies/x4v9e9rbhajfcsmux2or','movies/ywj3mye7flslbg0tbck3'),(14,NULL,'2023-05-05 11:10:21','Toy Story 2',3.2,2,'1999-04-04 00:00:00',120,'https://res.cloudinary.com/ericm76/image/upload/v1683285017/movies/umoxr1di2ffdrio9bt6x.jpg','Esta vez, la aventura y diversin contina cuando Andy se va a un campamento de verano y los juguetes permanecen en casa. La historia cambia cuando un coleccionista de juguetes obsesivo se lleva a Woody quien no tiene ni la ms mnima idea de lo que vale en el mercado. Ahora depende de Buzz Lightyear y el resto del equipo Seor Cara de Papa, Slinky, Rec y Hamm- emprender un viaje para salvar a su amigo de convertirse en una pieza de museo. La misin de los juguetes es muy emocionante ya que debern llegar a casa antes de que Andy lo haga.',7,'https://res.cloudinary.com/ericm76/image/upload/v1683285018/movies/c2smyoxwetvpqw84c6es.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683285021/movies/dqatiuwoc17kzstvcpma.jpg',0,0,1,'movies/umoxr1di2ffdrio9bt6x','movies/c2smyoxwetvpqw84c6es','movies/dqatiuwoc17kzstvcpma'),(15,NULL,'2023-05-05 11:11:24','La vida es bella',8.3,5,'1999-10-04 00:00:00',115,'https://res.cloudinary.com/ericm76/image/upload/v1683285081/movies/bv3ud2xwix0e24aypfii.jpg','Cuando un bibliotecario judo y su hijo se convierten en vctimas del Holocausto, l utiliza una mezcla perfecta de humor, voluntad y mucha imaginacin para proteger a su hijo de los peligros en su campamento.',3,'https://res.cloudinary.com/ericm76/image/upload/v1683285083/movies/dyrkdhdjkqlpdq7hk5gg.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683285084/movies/yywzlau2c3kxgk6k6fza.jpg',0,0,1,'movies/bv3ud2xwix0e24aypfii','movies/dyrkdhdjkqlpdq7hk5gg','movies/yywzlau2c3kxgk6k6fza'),(16,NULL,'2023-05-05 11:12:26','Mi pobre angelito',3.2,1,'1990-01-04 00:00:00',120,'https://res.cloudinary.com/ericm76/image/upload/v1683285143/movies/hfg9aaqqtvbxnbdskib3.webp','Kevin McAllister es un nio de ocho aos, miembro de una familia numerosa, que accidentalmente se queda abandonado en su casa cuando toda la familia se marcha a pasar las vacaciones a Francia. Kevin aprende a valerse por s mismo e incluso a protegerse de Harry y Marv, dos bribones que se proponen asaltar todas las casas cerradas de su vecindario. en cuanto su madre lo echa en falta, regresa apresuradamente a Chicago para recuperar a su hijo.',1,'https://res.cloudinary.com/ericm76/image/upload/v1683285144/movies/nylykky3sl0fycfgj2s0.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683285146/movies/qfzeeox5pptzngsubabt.jpg',0,0,1,'movies/hfg9aaqqtvbxnbdskib3','movies/nylykky3sl0fycfgj2s0','movies/qfzeeox5pptzngsubabt'),(17,NULL,'2023-05-05 11:13:16','Intensamente',9.0,2,'2008-07-04 00:00:00',120,'https://res.cloudinary.com/ericm76/image/upload/v1683285192/movies/ueeuqvypc42gyw3yc5fh.webp','Riley es una pequea de doce aos que se muda a San Francisco por culpa del trabajo de su pap. La idea del cambio no le parece una buena idea. La nia se acerca a la adolescencia y las emociones que conviven dentro de su cabeza arman una verdadera revolucin. Tristeza, Alegra, Desagrado, Furia y Temor se alternan el turno para controlar su comportamiento desde el centro de mando dentro su cabeza, lugar desde el que tambin se gestiona el almacenamiento de sus recuerdos. Cuando los preciosos recuerdos de la infancia se empiezan a fragmentar, Alegra y Tristeza se ven obligadas a abandonar el centro de mando para tratar de salvar los recuerdos de la nia del amenazante olvido. Intensamente es una cinta animada de Pixar que ofrece una mirada a lo ms profundo de nuestras emociones.',7,'https://res.cloudinary.com/ericm76/image/upload/v1683285194/movies/ogkzfmnlwgxbx5qjq2pi.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683285196/movies/fcgnegwhw1utn0eoknjy.webp',0,0,1,'movies/ueeuqvypc42gyw3yc5fh','movies/ogkzfmnlwgxbx5qjq2pi','movies/fcgnegwhw1utn0eoknjy'),(18,NULL,'2023-05-05 11:14:07','Carrozas de fuego',9.9,7,'1981-07-04 00:00:00',180,'https://res.cloudinary.com/ericm76/image/upload/v1683285244/movies/cv2hs0qjnliiloplnfzp.jpg','Dos atletas de pista britnicos, uno judo determinado y el otro cristiano devoto compiten en los Juegos Olmpicos de 1924.',NULL,'https://res.cloudinary.com/ericm76/image/upload/v1683285246/movies/xurwxto9jzwqxdue76gs.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683285247/movies/mcqhq3c7yitmyi8qefyk.jpg',0,1,1,'movies/cv2hs0qjnliiloplnfzp','movies/xurwxto9jzwqxdue76gs','movies/mcqhq3c7yitmyi8qefyk'),(20,NULL,'2023-05-05 11:15:21','I am Sam',9.0,4,'1999-03-04 00:00:00',130,'https://res.cloudinary.com/ericm76/image/upload/v1683285318/movies/bipqh0vcwemidxvkdveg.jpg','Una mujer sin techo abandona a su hija el mismo da en que nace dejndola en manos de su padre, Sam Dawson, quien tiene una deficiencia mental, ya que ella no quera tener un beb con l, solo buscaba un lugar donde dormir. La pelcula narra, al comps de los Beatles, las dificultades que tienen que atravesar cuando, a partir de los 7 aos, Lucy empieza a tener ms capacidad mental que su padre. El Estado se cuestiona la capacidad de Sam para educar a su hija por lo que se enfrenta a un juicio que le puede hacer perder su custodia.',3,'https://res.cloudinary.com/ericm76/image/upload/v1683285320/movies/y9er7scndvymfuzlalml.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683285322/movies/sww9st5jjatfdeznfuit.webp',1,0,1,'movies/bipqh0vcwemidxvkdveg','movies/y9er7scndvymfuzlalml','movies/sww9st5jjatfdeznfuit'),(21,NULL,'2023-05-18 13:18:55','Hotel Transylvania',7.1,1,'2012-05-04 00:00:00',90,'https://res.cloudinary.com/ericm76/image/upload/v1683285377/movies/zhm1drrtfdr3jm892ilj.jpg','Bienvenido al Hotel Transylvania de Drcula, fastuoso resort de cinco estrellas, donde los monstruos y sus familias pueden vivir libres de ser monstruos que son sin que los seres humanos los molesten. En un fin de semana especial, Drcula ha invitado a algunos de los monstruos ms famosos del mundo - Frankenstein y su novia, la Momia, el Hombre Invisible, una familia de hombres lobo, y ms - para celebrar el cumpleaos nmero 118 de su hija Mavis. Para Drcula, atender a todos esos monstruos legendarios no es problema - pero su mundo puede derrumbarse cuando un chico ordinario tropieza en el hotel.',10,'https://res.cloudinary.com/ericm76/image/upload/v1683285379/movies/w9jy0chfnbbe3uoycw5i.jpg','https://res.cloudinary.com/ericm76/image/upload/v1684415935/movies/movies/sv6kxw7dnj8e9pwdkguz.jpg',0,1,1,'movies/zhm1drrtfdr3jm892ilj','movies/w9jy0chfnbbe3uoycw5i','movies/movies/sv6kxw7dnj8e9pwdkguz'),(22,NULL,'2023-05-05 11:17:21','Titanes del pacfico',9.0,7,'2013-09-09 00:00:00',120,'https://res.cloudinary.com/ericm76/image/upload/v1683285438/movies/hdycoeqclo9dkjhufufk.jpg','Cuando legiones de monstruosas criaturas, denominadas Kaiju, comienzan a salir del mar, se inicia una guerra que acabar con millones de vidas y que consumir los recursos de la humanidad durante interminables aos. Para combatir a los Kaiju gigantes disean un tipo especial de arma: enormes robots, llamados Jaegers, que son controlados simultneamente por dos pilotos cuyas mentes estn bloqueadas en un puente neural. Pero incluso los Jaegers proporcionan poca defensa ante los incansables Kaiju. A punto de la derrota, las fuerzas que defienden a la humanidad no tienen otra eleccin que recurrir a dos inslitos hroes: un ex piloto acabado (Charlie Hunnam) y un aprendiz que todava no se ha puesto a prueba (Rinko Kikuchi). Ambos se unen para traer a un legendario pero al parecer obsoleto Jaeger del pasado. Juntos, son la ltima esperanza de la humanidad frente al Apocalipsis que se avecina.',4,'https://res.cloudinary.com/ericm76/image/upload/v1683285440/movies/mgt5rpac2wo8hab6ni0j.jpg','https://res.cloudinary.com/ericm76/image/upload/v1683285441/movies/ghn5zxnyy2dfk9eg5l50.jpg',0,0,1,'movies/hdycoeqclo9dkjhufufk','movies/mgt5rpac2wo8hab6ni0j','movies/ghn5zxnyy2dfk9eg5l50'),(34,'2023-05-03 19:53:49','2023-05-05 11:32:14','Aquaman',9